import React, { Component } from "react";
import Slider from "react-slick";
import CardNewRelease from "../components/CardNewRelease";

export default class AutoPlay extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      slidesToShow: 3,
      slidesToScroll: 1,
      autoplay: true,
      speed: 3000,
      autoplaySpeed: 3000,
      cssEase: "linear",
    };
    return (
      <div className="site-container section-new-release">
        <h2 className="main-heading">New Release</h2>
        <Slider {...settings}>
          <div>
            <CardNewRelease />
          </div>
          <div>
            <CardNewRelease />
          </div>
          <div>
            <CardNewRelease />
          </div>
          <div>
            <CardNewRelease />
          </div>
          <div>
            <CardNewRelease />
          </div>
          <div>
            <CardNewRelease />
          </div>
        </Slider>
      </div>
    );
  }
}
